import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import Board from './components/Board';
import Division from './components/Division';

const BoardPage = () => {
    return (
        <>
        <Header />
        <br></br>
        <br></br>
        <table>
            <thead>
                <tr>
                    <th>ㅤㅤㅤㅤㅤㅤㅤ</th>
                    <th><Division /></th>
                    <th>ㅤㅤㅤ</th>
                    <th><Division /></th>
                    <th>ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ</th>
                    <th><Division /></th>
                </tr>
            </thead>
            <tbody>
                <tr><br></br></tr>
                <tr>
                    <td>ㅤㅤㅤㅤㅤㅤㅤ</td>
                    <td><Board />
                    </td>
                </tr>
            </tbody>
        </table>
        <br></br>
        <br></br>
        <br></br>
        <Footer />
        </>
    );
};

export default BoardPage;
